Patch Set 3:

> If an event is posted by a thread in a QObject::event handler (that's how I interpret your statement), then there's no multi-threadedness going on. wakeUps will always be reset by the sendPostedEvents that delivered the event that resulted in a postEvent; and so postEvent will always result in a new WM_QT_SENDPOSTEDEVENTS being posted.

Yes, you are right.

> Also, do you think this patch is wrong, or does it simply not fix all possible scenarios?

The patch looks good for me now. But, I'm a little confused by the comment from QCoreApplicationPrivate::sendPostedEvents():

// by default, we assume that the event dispatcher can go to sleep after
// processing all events. if any new events are posted while we send
// events, canWait will be set to false.

Then it sets canWait to true which we check in the event dispatcher before blocking. So, is it okay not to block if pending posted events have been processed but new events have not been posted?

Patch Set 4:

> Not sure if I understand your question correctly though.

Yes. I meant the following case:

worker thread                event dispatcher                   wakeUps    threadData->canWait
==============================================================================================
                             processEvents()
                             sendPostedEvents                   0          true
postEvent(event_num == 1)                                       0          false
post WM_QT_SENDPOSTEDEVENTS                                     1          false
postEvent(event_num == 2)                                       1          false
                             receive WM_QT_SENDPOSTEDEVENTS     0          false
                             skip waiting                       0          false

                             processEvents()                    0          false
                             sendPostedEvents                   0          true
                             sendEvent(event_num == 1)          0          true
                             sendEvent(event_num == 2)          0          true
                             MsgWaitForMultipleObjectsEx // deadlock

Can be reproduced even in a single-threaded app:

struct EventReceiver : public QObject {
        int i = 0;

	bool event(QEvent* event) override;
};

bool EventReceiver::event(QEvent* event) {
	if (event->type() == QEvent::User) {
                ++i;
		std::cout << i << " Ping\n";
                if (i < 2)
                    QCoreApplication::postEvent(this, new QEvent(QEvent::User));
		return true;
	}
	return false;
}

int main(int argc, char** argv) {

	QApplication app(argc, argv);

	EventReceiver receiver;
        QCoreApplication::postEvent(&receiver, new QEvent(QEvent::User));
        while (receiver.i < 2) {
            QCoreApplication::processEvents(QEventLoop::WaitForMoreEvents);
            std::cout << receiver.i << " Pong\n";
        }

	return 0;
}

